// Funcionas en JS
const saludar = function(nombre) {
    return ` Hola ${nombre}`;
}

// Funcion de flecha
const saludar2 = (nombre) => {
    return ` Hola ${nombre}`;
}

console.log(saludar('Goku'));
console.log(saludar2('Vegeta'));
